import React from 'react'
import './ThirdSectionForMainPage.scss'
import ColorSizePrice from "../Components/ColorSizePrice";

export const ThirdSectionForMainPage = () => {
    return (
        <div className="Container-wrappera">
            <div className="wrapper">
                <div className="divForImageProduct">
                    <img src="./images/CircularRoseGold.jpg" alt="картинка"/>
                </div>
                <ColorSizePrice Color="Розовое золото" Size="30x30" Price="500₽"/>
            </div>
        </div>
    )
}

export default ThirdSectionForMainPage;
